  `codigo` varchar(50) NOT NULL,
  `ubicacion` varchar(50) DEFAULT NULL,
  `sector` varchar(50) DEFAULT NULL,
  `tipo` varchar(50) DEFAULT NULL,
  `fecha` date DEFAULT NULL,
  `descripcion` varchar(250) DEFAULT NULL,
